/**
 * @param {string} word
 * @param {string[]} forbidden
 * @return {number}
 */
var longestValidSubstring = function(word, forbidden) {
    const n = word.length;
    let maxLen = 0, left = 0, right = 0;
    let valid = true;

    while (right <= n) {
        valid = true;
        for (let f of forbidden) {
            if (word.substring(left, right).includes(f)) {
                valid = false;
                break;
            }
        }
        if (valid) {
            maxLen = Math.max(maxLen, right - left);
            right++;
        } else {
            left++;
            if (left > right) right = left;
        }
    }

    return maxLen;
};
